import UIKit

class BodyMapPicker: UIView {

    weak var delegate: BodyMapPickerDelegate!
    
    var lightColor: UIColor = UIColor(red: 0.6798, green: 0.8925, blue: 1.0, alpha: 1.0)
    var baseColor: UIColor = UIColor(red: 0.301, green: 0.748, blue: 1.0, alpha: 1.0)
    
    var strokeColor = UIColor.whiteColor()
    var strokeWidth: CGFloat = 1.0
    
    var front = true
    
    var imageMapParts = [ImageMapPart]()
    var selectionIndex = [Bool]()
    
    var selectedPartIndex: Int! {
        didSet {
            self.setNeedsDisplay()
        }
    }
    
    var selectedMapPart: ImageMapPart? {
        didSet {
            delegate.imageMapTitle(selectedMapPart!.title)
            
            delegate.imageMapText?(selectedMapPart!.text!)
        }
    }
    
    var touchLocation = CGPoint()
    
    override init(frame: CGRect) {
        super.init(frame: frame)
        
        setupMapParts(frame)
        setupSelectionIndex()
        
        let frontView = UIView()
        let backView = UIView()
        
        self.addSubview(frontView)
        self.addSubview(backView)
        
        frontView.drawRect(frame)
    }
    
    required init?(coder aDecoder: NSCoder) {
        super.init(coder: aDecoder)
        setupMapParts(frame)
        setupSelectionIndex()
    }
    
    override func drawRect(rect: CGRect) {
        drawBody(front)
    }
    
    func rotate(withAnimation animation: Bool) {
        // TODO: - Add rotating code here
    }
    
    func drawBody(front:Bool) {
        
        for imageMapPart in imageMapParts {
            if imageMapPart.front == front {
                if selectionIndex[imageMapParts.indexOf(imageMapPart)!] == true {
                    baseColor.setFill()
                    selectedMapPart = imageMapPart
                } else {
                    lightColor.setFill()
                }
                imageMapPart.path.fill()
                strokeColor.setStroke()
                imageMapPart.path.lineWidth = strokeWidth
                imageMapPart.path.stroke()
            }
        }
    }
    
    override func hitTest(point: CGPoint, withEvent event: UIEvent?) -> UIView? {
        for (index, _) in imageMapParts.enumerate() {
            if imageMapParts[index].path.containsPoint(point) {
                selectedPartIndex = index
                selectionIndex[index] = true
            } else {
                selectionIndex[index] = false
            }
        }
        return super.hitTest(point, withEvent: event)
    }
    
    //override func touchesBegan(touches: Set<UITouch>, withEvent event: UIEvent?) {
      
    //}
   
    
