@objc protocol BodyMapPickerDelegate {
    func imageMapTitle(titleString: String)
    optional func imageMapText(textString: String)
}

struct ImageMapPart: Equatable {
    let front: Bool
    let path: UIBezierPath
    let title: String
    var text: String?
    
    init(path: UIBezierPath, title: String, front: Bool, text: String) {
        self.front = front
        self.path = path
        self.title = title
        self.text = text
    }
    
    init(path: UIBezierPath, title: String, front: Bool) {
        self.front = front
        self.path = path
        self.title = title
    }
}

func ==(lhs: ImageMapPart, rhs: ImageMapPart) -> Bool {
    return lhs.title == rhs.title
}
